import React from 'react';
import {Link} from 'react-router-dom';

function NavBar() {
    return (
        <ul>
            <li><Link to="/administrator">Logout</Link></li>
            <li><Link to="/administrator/front">Front Page</Link></li>
            <li><Link to="/administrator/ad">Advertisement</Link></li>
            <li><Link to="/administrator/users">Users</Link></li>
        </ul>
    )
}

export default NavBar;
